import React from 'react'
import '../CSS/Work.css'

function WorkPage() {

    var myArray = ["one", "Two", "Three", "Four", "Five", "Six", "Seven", "Eight", "Nine", "Ten"];

    return (
        <div className="work-page">
            <br></br>
            {myArray.map((item) => <div style={{ backgroundColor: 'tomato', margin: '10px' }}>{item}</div>)}
        </div>
    )
}

export default WorkPage
